function App() {
  const [TastEditOpen, setTaskEditOpen] = useState(false);
  return (
    <div className="App" style={{minWidth:"1080px"}}>
      <Header />
      <div style={{ display: "flex", flexDirection: "row", height: "100vh",width : "100%" }}>
        <Sidebar />
        <ContentBody taskEditor={setTaskEditOpen}/>
      </div>
    </div>
  );
}

export default App;
